import { Nav, Navbar, NavDropdown } from "react-bootstrap";
import React from "react";
import { useNavigate } from "react-router";

function AdminDashboard() {
  const navigate = useNavigate();

  return (
    <div>
      <Navbar bg="dark" variant="dark" style={{ padding: 10 }}>
        <Navbar.Brand>
          <h2>INFOLIBRA</h2>
        </Navbar.Brand>

        <Nav className="me-auto mr-4">
          <Nav.Link>Admin Dashboard</Nav.Link>
          <Nav.Link>Orders</Nav.Link>
        </Nav>

        <Navbar.Collapse className="justify-content-end">
          {localStorage.getItem("isLoggedIn") ? (
            <React.Fragment>
              <NavDropdown title="Options" id="basic-nav-dropdown">
                <NavDropdown.Item onClick={() => console.log("Add clicked")}>
                  Add
                </NavDropdown.Item>
                <NavDropdown.Item onClick={() => console.log("Delete clicked")}>
                  Delete
                </NavDropdown.Item>
                <NavDropdown.Item onClick={() => console.log("Update clicked")}>
                  Update
                </NavDropdown.Item>
                <NavDropdown.Item onClick={() => console.log("Status clicked")}>
                  Status
                </NavDropdown.Item>
                <NavDropdown.Divider />
                <NavDropdown.Item
                  onClick={() => {
                    localStorage.clear();
                    navigate("/auth/login?msg=you have logged out..");
                  }}
                >
                  Logout
                </NavDropdown.Item>
              </NavDropdown>

              <Navbar.Text>
                Signed in as:{" "}
                <span style={{ color: "white" }}>
                  {localStorage.getItem("username")}
                </span>
              </Navbar.Text>
            </React.Fragment>
          ) : (
            <button
              className="btn btn-primary"
              onClick={() => navigate("/auth/login")}
            >
              Login
            </button>
          )}
        </Navbar.Collapse>
      </Navbar>
    </div>
  );
}

export default AdminDashboard;
